Use $match on fields from two separate collections in an aggregate query mongodb<p>I have an aggregate query where I join 3 collections. I'd like to filter the search based on fields from two of those collections. The problem is, I'm only able to use $match on the initial collection that mongoose initialized with.</p>

<p>Here's the query:</p>

<pre><code>var pipeline = [
    {
        $lookup: {
            from: 'blurts',
            localField: 'followee',
            foreignField: 'author.id',
            as: 'followerBlurts'
        }
    },
    {
        $unwind: '$followerBlurts'
    },
    {
        $lookup: {
            from: 'users',
            localField: 'followee',
            foreignField: '_id',
            as: 'usertbl'
        }
    },
    {
        $unwind: '$usertbl'
    },
    {
        $match: {
            'follower': { $eq: req.user._id },
            //'blurtDate': { $gte: qryDateFrom, $lte: qryDateTo }
        }
    },
    {
        $sample: { 'size': 42 }
    },
    {
        $project: {
            _id: '$followerBlurts._id',
            name: '$usertbl.name',
            smImg: '$usertbl.smImg',
            text: '$followerBlurts.text',
            vote: '$followerBlurts.vote',
            blurtDate: '$followerBlurts.blurtDate',
            blurtImg: '$followerBlurts.blurtImg'
        }
    }
];

keystone.list('Follow').model.aggregate(pipeline)
.sort({blurtDate: -1})
.cursor().exec()
.toArray(function(err, data) {
    if (!err) {
        res.json(data);
    } else {
        console.log('Error getting following blurts --&gt; ' + err);
    }
});
</code></pre>

<p>Within the pipeline, I can only use $match on the 'Follow' model. When I use $match on the 'Blurt' model, it simply ignores the condition (you can see where I tried to include it in the commented line under $match).</p>

<p>What's perplexing is that I can utilize this field in the .sort method, but not in the $match conditions. </p>

<p>Any help much appreciated.</p>

