</code></pre>; Answer: @Ian, can you try strongly typing your returns? On this page https://msdn.microsoft.com/en-us/library/gg671236(v=vs.103).aspx at the bottom it says: When you call the Include method, the query path is only valid on the returned instance of the IQueryable of T. Other instances of IQueryable of T and the context itself are not affected. You can call this method multiple times on an IQueryable of T to specify multiple paths for the query.

