Complex Mongoose Filter Query<p>I'm building a site that allows users to filter results using a sidebar. The more criteria they select, the more specific their search results should be (see attached image).</p>

<p>Users can select filters (checkboxes) that match what they're looking for. I'm using MongoDB for this. My schema is as follows:</p>

<pre><code>brandName: {
    type: String,
    required: false
  },
productType: {
    type: String,
    required: false
  },
  skincareConcern: {
    type: Array,
    required: false
  },
  ingredients: {
    type: Array,
    required: false
  },
  skinType: {
    type: Array,
    required: false
  }
</code></pre>

<p>Right now, I'm using a <code>.find()</code> with an <code>$or</code> query but this isn't correct, namely because the <code>$or</code> returns all the matches for any of these criteria. I need the results to filter/narrow down the more criteria I include. </p>

<p>See my current code below:</p>

<pre><code>Products.find({
    $or: [
      { brandName : { $in : brands, $exists: true, $ne: [] } },
      { skincareConcern : { $in : skincareConcerns, $exists: true, $ne: [] } },
      { productType : { $in : productTypes, $exists: true, $ne: [] } },
      { ingredients : { $in : ingredients, $exists: true, $ne: [] } },
      { skinTypes : { $in : skinTypes, $exists: true, $ne: [] } }
    ]
  }
</code></pre>

<p>Sample payload:</p>

<pre><code>{"brands":["ACWELL","BOTANIC FARM"],"skincareConcerns":[],"productTypes":["essence","moisturizer"],"ingredients":[],"skinType":[]}
</code></pre>

<p><a href="https://i.stack.imgur.com/3eTAu.png" rel="noreferrer"><img src="https://i.stack.imgur.com/3eTAu.png" alt="enter image description here"></a></p>

