MongoDB index not used when sorting, although prefix matches<p>I'm trying to fetch a set of records in the most efficient way from MongoDB, but it goes wrong when I add a sorting stage to the pipeline. The server does not use my intended index. According to the documentation it should however match the prefix:
<a href="https://docs.mongodb.com/manual/tutorial/sort-results-with-indexes/#sort-and-non-prefix-subset-of-an-index" rel="nofollow noreferrer">https://docs.mongodb.com/manual/tutorial/sort-results-with-indexes/#sort-and-non-prefix-subset-of-an-index</a></p>

<p>I have an index which looks like this:</p>

<pre><code>{
    "v" : 2,
    "key" : {
        "account_id" : 1,
        "cdr_block" : 1,
        "billing.total_billed" : 1,
        "times.created" : -1 
     },
     "name" : "IDX_by_account_and_block_sorted"
}
</code></pre>

<p>So I would suppose that when I filter on <code>account_id</code>, <code>cdr_block</code> and <code>billing.total_billed</code>, followed by a sort on <code>times.created</code>, the index would be used.</p>

<p>However that is not the case; when I check the query explanations in MongoDB shell;
this one does NOT use the index, but uses an index that is composed of <code>times.created</code> only, so it takes a few minutes:</p>

<pre><code>db.getCollection("cdr").aggregate(
    [
        { 
            "$match" : {
                "account_id" : 160.0, 
                "cdr_block" : ObjectId("5d11e0364f853f15824aff47"), 
                "billing.total_billed" : {
                    "$gt" : 0.0
                }
            }
        }, 
        { 
            "$sort" : {
                "times.created" : -1.0
            }
        }
    ], 
    { 
        "allowDiskUse" : true
    }
);
</code></pre>

<p>If I leave out the $sort stage, it does use my above mentioned index.</p>

<p>I was thinking that it was perhaps due to the fact that it's an aggregation, but this 'regular' query also doesn't use the index:</p>

<pre><code>db.getCollection("cdr").find({ 
    "account_id" : 160.0, 
    "cdr_block" : ObjectId("5d11e0364f853f15824aff47"), 
    "billing.total_billed" : {
        "$gt" : 0.0
    }
}).sort({"times.created" : -1 });

</code></pre>

