In React, how do I display the results from an API get request?<p>I've created API's for a standard transaction application (using mongoDB for DB), I have API's for users, products and orders. I managed to use and display the information stored about users and products, however, when I try to follow the same code for displaying my orders (which shares objects from products and users, in mongoDB collections) I get stuck. I know this has something to do with how I've named (const { _id, username, useremail, productname, productsellprice } = order;) as the _id works.</p>

<p>Other details: using= axios for http requests; context api with hooks (useContext, useReducer)</p>

<p>Im new to all this so forgive me if I've left out crucial information.</p>

<pre><code>import React, { useContext } from 'react';
    import PropTypes from 'prop-types';
    import OrderContext from '../../context/order/orderContext';

    const OrderItem = ({ order }) =&gt; {
      const orderContext = useContext(OrderContext);
      const { deleteOrder, setCurrent, clearCurrent } = orderContext;

      const { _id, username, useremail, productname, productsellprice } = order;

      const onDelete = () =&gt; {
        deleteOrder(_id);
        clearCurrent();
      };

      return (
        &lt;div className='card bg-light'&gt;
          &lt;h3 className='text-primary text-left'&gt;
            {_id}{' '}
            &lt;span
              style={{ float: 'right' }}
              className={
                'badge ' +
                (productsellprice === 'professional' ? 'badge-success' : 'badge-primary')
              }
            &gt;
              {' ' + productsellprice}
            &lt;/span&gt;
          &lt;/h3&gt;
          &lt;ul className='list'&gt;
            {useremail &amp;&amp; (
              &lt;li&gt;
                &lt;i className='fas fa-marker' /&gt; {useremail}
              &lt;/li&gt;
            )}
            {productname &amp;&amp; (
              &lt;li&gt;
                &lt;i className='fas fa-marker' /&gt; {productname}
              &lt;/li&gt;
            )}
          &lt;/ul&gt;
          &lt;p&gt;
            &lt;button
              className='btn btn-dark btn-sm'
              onClick={() =&gt; setCurrent(order)}
            &gt;Edit
            &lt;/button&gt;
            &lt;button className='btn btn-danger btn-sm' onClick={onDelete}&gt;
              Delete
            &lt;/button&gt;
          &lt;/p&gt;
        &lt;/div &gt;
      );
    };

    OrderItem.propTypes = {
      order: PropTypes.object.isRequired
    };

    export default OrderItem;
</code></pre>

